package com.list.programs;

public class ConditionalFalseIf {

	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10, a=20;
		
		if(i>a) {
			System.out.println("welcome to if first false");
		}
		if(i==a) {
			System.out.println("welcome to if first second");
		}
		if(i>=a) {
			System.out.println("welcome to if first third");
		}
		if(a<i) {
			System.out.println("welcome to if first fourth");
		}
	}

}
